import React, { Component } from 'react'
import Title from './Title'

import { Route } from 'react-router-dom';
import bivakzones from '../bivakzones.json';
import { Card } from 'react-bootstrap';

class Main extends Component {

    render() {

        console.log(bivakzones.features[2])
        return (
            <div>
                <Route exact path="/gallery" render={() => (
                    <div>
                        <Title title={'PhotoWall'} />

                        {
                            bivakzones.features
                                .map((bivakzone) => {
                                    if (bivakzone.geometry.type === 'Point') {
                                        return (bivakzone)

                                    } else {
                                        bivakzone.geometry.coordinates =
                                            bivakzone.geometry.coordinates[0][0]
                                        bivakzone.geometry.type = 'Point'
                                        return (bivakzone)
                                    }
                                })

                                .map((bivakzone) => (
                                    <ul bivakzone={bivakzone}>

                                        <Card>
                                            <Card.Title>{bivakzone.properties.name}</Card.Title>
                                            <Col xs={6} md={4}>
                                                <Card.Img bg="info" className="image" variant="top" src={`${bivakzone.properties.image}`} thumbnail />
                                            </Col>
                                        </Card>

                                    </ul>
                                ))
                        }



                    </div>
                )} />

            </div>
        )
    }
}

export default Main;
